import React, { useState, useEffect } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import LandingPage from './pages/LandingPage';
import LoginPage from './pages/LoginPage';
import SignupPage from './pages/SignupPage';
import AppShell from './components/AppShell';
import Dashboard from './pages/Dashboard';
import Teams from './pages/Teams';
import TeamMember from './pages/TeamMember';
import Surveys from './pages/Surveys';
import Reports from './pages/Reports';
import EntryFlow from './pages/EntryFlow';

function App() {
  const [isAuthenticated, setIsAuthenticated] = useState(false);

  useEffect(() => {
    // Check if user is authenticated from localStorage
    const authStatus = localStorage.getItem('isAuthenticated');
    if (authStatus === 'true') {
      setIsAuthenticated(true);
    }
  }, []);

  return (
    <Router>
      <div className="App">
        <Routes>
          {/* Public routes */}
          <Route path="/" element={
            isAuthenticated ? <Navigate to="/app/dashboard" /> : <LandingPage />
          } />
          <Route path="/login" element={
            isAuthenticated ? <Navigate to="/app/dashboard" /> : <LoginPage />
          } />
          <Route path="/signup" element={
            isAuthenticated ? <Navigate to="/app/dashboard" /> : <SignupPage />
          } />

          {/* Protected app routes */}
          <Route path="/app/dashboard" element={
            isAuthenticated ? (
              <AppShell>
                <Dashboard />
              </AppShell>
            ) : <Navigate to="/login" />
          } />
          <Route path="/app/teams" element={
            isAuthenticated ? (
              <AppShell>
                <Teams />
              </AppShell>
            ) : <Navigate to="/login" />
          } />
          <Route path="/app/teams/:memberId" element={
            isAuthenticated ? (
              <AppShell>
                <TeamMember />
              </AppShell>
            ) : <Navigate to="/login" />
          } />
          <Route path="/app/surveys" element={
            isAuthenticated ? (
              <AppShell>
                <Surveys />
              </AppShell>
            ) : <Navigate to="/login" />
          } />
          <Route path="/app/reports" element={
            isAuthenticated ? (
              <AppShell>
                <Reports />
              </AppShell>
            ) : <Navigate to="/login" />
          } />
          <Route path="/app/entry" element={
            isAuthenticated ? (
              <AppShell>
                <EntryFlow />
              </AppShell>
            ) : <Navigate to="/login" />
          } />

          {/* Catch all route */}
          <Route path="*" element={<Navigate to="/" />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
